### Step 2: Define the Manifest File

The `manifest.json` file is crucial as it contains metadata for your extension. Open `manifest.json` and add the following content:

```json
{
  "manifest_version": 2,
  "name": "Web Page Screenshot",
  "version": "1.0",
  "description": "A Chrome extension to take screenshots of web pages.",
  "permissions": ["activeTab"],
  "browser_action": {
    "default_popup": "popup.html"
  },
  "content_scripts": [
    {
      "matches": ["<all_urls>"],
      "js": ["screenshot.js"]
